        const navStyle = {
            color:'white'
        }
        return(
            <nav className = "Nav">
            <h3>Logo</h3>

            { ((localStorage.getItem("jwt")===null)||(localStorage.getItem("jwt")=='undefined'))?//(localStorage.getItem("jwt")===null)||
